import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom/client';

function App() {
  const [showPopup, setShowPopup] = useState(false);
  const [huskyPhotos, setHuskyPhotos] = useState([]);

  useEffect(() => {
    document.title = 'Yuki App';
    // Fetch random husky photos
    const fetchHuskyPhotos = async () => {
      const photos = [];
      for (let i = 0; i < 3; i++) {
        const response = await fetch('https://dog.ceo/api/breed/husky/images/random');
        const data = await response.json();
        photos.push(data.message);
      }
      setHuskyPhotos(photos);
    };
    fetchHuskyPhotos();
  }, []);

  const handleButtonClick = () => {
    setShowPopup(true);
  };

  const handleClosePopup = () => {
    setShowPopup(false);
  };

  return (
    <div className="App" style={{ 
      display: 'flex', 
      flexDirection: 'column', 
      alignItems: 'center', 
      justifyContent: 'center', 
      minHeight: '100vh',
      backgroundColor: '#F0E6FF',
      padding: '20px'
    }}>
      <div style={{ 
        width: '80%', 
        maxWidth: '600px', 
        backgroundColor: 'white', 
        padding: '20px', 
        borderRadius: '10px',
        boxShadow: '0 0 10px rgba(0,0,0,0.1)',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'
      }}>
        <header className="App-header" style={{ textAlign: 'center' }}>
          Hello World
        </header>
        <button 
          onClick={handleButtonClick}
          style={{
            backgroundColor: 'white',
            border: '2px solid black',
            padding: '10px 20px',
            marginTop: '20px',
            cursor: 'pointer'
          }}
        >
          <span style={{ color: 'purple' }}>Yuki</span>
        </button>
        <div style={{ 
          display: 'flex', 
          justifyContent: 'space-between', 
          marginTop: '20px',
          width: '100%'
        }}>
          {huskyPhotos.map((photo, index) => (
            <div key={index} style={{ width: '30%', textAlign: 'center' }}>
              <img 
                src={photo} 
                alt={`Husky ${index + 1}`} 
                style={{ width: '100%', height: 'auto', objectFit: 'cover' }}
              />
              <a 
                href={photo} 
                target="_blank" 
                rel="noopener noreferrer" 
                style={{ 
                  color: 'purple', 
                  fontStyle: 'italic', 
                  fontSize: '0.8em',
                  textDecoration: 'none'
                }}
              >
                Original Photo
              </a>
            </div>
          ))}
        </div>
      </div>
      {showPopup && (
        <div style={{
          position: 'fixed',
          top: '50%',
          left: '50%',
          transform: 'translate(-50%, -50%)',
          backgroundColor: 'white',
          padding: '20px',
          border: '1px solid black',
          zIndex: 1000
        }}>
          <p>missus chan</p>
          <button onClick={handleClosePopup}>Close</button>
        </div>
      )}
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
